import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

const People = ({people}) => {
  console.log(people);
  return (
      <div>
          <center><h1>Contact List</h1></center>
          {people.map((character) => (
              <div class="card">
                  <div class="card-body">
                      <h5 class="card-title">{character.name}</h5>
                      <h6 class="card-subtitle mb-2 text-muted">{character.email}</h6>
                      <p class="card-text">{character.company.catchPhrase}</p>
                  </div>
              </div>
          ))}
      </div>
  )
};

class App extends Component {

  state = {
    people: []
  }

  componentDidMount() {
        fetch('http://swapi.dev/api/people/')
        .then(res => res.json())
        .then((data) => {
          this.setState({ people: data })
        })
        .catch(console.log)
  }

  render() {
    return (
      <People people={this.state.people} />
    );
  }
}

export default App;
